import React, { useState } from 'react';
import './App.css';

function App() {
  const [audioFile, setAudioFile] = useState(null);
  const [isAnalyzing, setIsAnalyzing] = useState(false);
  const [result, setResult] = useState(null);

  // ÌååÏùº ÏÑ†ÌÉù Ìï∏Îì§Îü¨
  const handleFileChange = (event) => {
    const file = event.target.files[0];
    if (file && file.type.startsWith('audio/')) {
      setAudioFile(file);
      setResult(null); // ÏÉà ÌååÏùº ÏÑ†ÌÉù Ïãú Ïù¥Ï†Ñ Í≤∞Í≥º Ï¥àÍ∏∞Ìôî
    } else {
      alert('ÏùåÏÑ± ÌååÏùºÏùÑ ÏÑ†ÌÉùÌï¥Ï£ºÏÑ∏Ïöî.');
    }
  };

  // Î∂ÑÏÑù ÏöîÏ≤≠ Ìï∏Îì§Îü¨
  // Î∂ÑÏÑù ÏöîÏ≤≠ Ìï∏Îì§Îü¨
const handleAnalyze = async () => {
  if (!audioFile) {
    alert('Î®ºÏ†Ä ÏùåÏÑ± ÌååÏùºÏùÑ ÏÑ†ÌÉùÌï¥Ï£ºÏÑ∏Ïöî.');
    return;
  }

  setIsAnalyzing(true);

  try {
    // FormDataÎ°ú ÌååÏùº Ï†ÑÏÜ°
    const formData = new FormData();
    formData.append('audio', audioFile);

    // Flask API Ìò∏Ï∂ú
    const response = await fetch('http://localhost:5000/api/classify', {
      method: 'POST',
      body: formData
    });

    if (!response.ok) {
      throw new Error('API ÏöîÏ≤≠ Ïã§Ìå®');
    }

    const data = await response.json();
    setResult(data);
  } catch (error) {
    console.error('Error:', error);
    alert('Î∂ÑÏÑù Ï§ë Ïò§Î•òÍ∞Ä Î∞úÏÉùÌñàÏäµÎãàÎã§: ' + error.message);
  } finally {
    setIsAnalyzing(false);
  }
};

  return (
    <div className="App">
      <header className="App-header">
        <h1>üéôÔ∏è UK Accent Classifier</h1>
        <p>ÏòÅÍµ≠ Î∞©Ïñ∏ Î∂ÑÎ•òÍ∏∞</p>
      </header>

      <main className="App-main">
        {/* ÌååÏùº ÏóÖÎ°úÎìú ÏÑπÏÖò */}
        <div className="upload-section">
          <label htmlFor="audio-upload" className="upload-label">
            ÏùåÏÑ± ÌååÏùº ÏÑ†ÌÉù
          </label>
          <input
            id="audio-upload"
            type="file"
            accept="audio/*"
            onChange={handleFileChange}
            className="file-input"
          />
          {audioFile && (
            <p className="file-name">ÏÑ†ÌÉùÎêú ÌååÏùº: {audioFile.name}</p>
          )}
        </div>

        {/* Î∂ÑÏÑù Î≤ÑÌäº */}
        <button
          onClick={handleAnalyze}
          disabled={!audioFile || isAnalyzing}
          className="analyze-button"
        >
          {isAnalyzing ? 'Î∂ÑÏÑù Ï§ë...' : 'Î∂ÑÏÑùÌïòÍ∏∞'}
        </button>

        {/* Í≤∞Í≥º ÌëúÏãú ÏÑπÏÖò */}
        {result && (
          <div className="result-section">
            <h2>Î∂ÑÏÑù Í≤∞Í≥º</h2>
            <div className="main-result">
              <p className="accent-label">Í∞êÏßÄÎêú Î∞©Ïñ∏:</p>
              <p className="accent-value">{result.accent}</p>
              <p className="confidence">
                Ïã†Î¢∞ÎèÑ: {(result.confidence * 100).toFixed(1)}%
              </p>
            </div>

            <div className="all-probabilities">
              <h3>Î™®Îì† ÏßÄÏó≠ ÌôïÎ•†</h3>
              {Object.entries(result.allProbabilities)
                .sort(([, a], [, b]) => b - a)
                .map(([accent, prob]) => (
                  <div key={accent} className="probability-bar">
                    <span className="accent-name">{accent}</span>
                    <div className="bar-container">
                      <div
                        className="bar-fill"
                        style={{ width: `${prob * 100}%` }}
                      />
                    </div>
                    <span className="probability-value">
                      {(prob * 100).toFixed(1)}%
                    </span>
                  </div>
                ))}
            </div>
          </div>
        )}
      </main>
    </div>
  );
}

export default App;
